INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES (0, 0, 1, "お！\nあそこに困ってそうな人発見！", "ねぇねぇ、騎士クン\n手伝ってあげようよ～", 1001, 0, 1.4, 1, 0, "ヒヨリでっす♪\n元気いっぱいがんばるよ♪", 1, 0, 2, "春咲 ひより");
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES (0, 0, 1, "大切な人を\n守れるようになりたい…って", "わ、わたし、\nなに言ってるんだろ\nあはは…", 1002, 0, 1.4, 1, 0, "みんなみたいに\nわたしも強くならなきゃ", 1, 0, 2, "草野 優衣");
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES (0, 0, 1, "キミに必要な集中力と感性が", "少しは磨かれると思いますよ。", 1003, 0, 1.4, 1, 0, "フェンシングを始めてみては？", 1, 0, 2, "士条 怜");
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES (0, 0, 1, "今日はなにして遊ぶ？", "みそぎはねぇ、\nかくれんぼやりたい！", 1004, 0, 1.5, 1, 0, "ねぇ、にいちゃん！", 1, 0, 2, "穂高 みそぎ");
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES (0, 0, 1, "ねぇ…", "私といっしょに…\nいかない？", 1006, 0, 1.4, 1, 0, "風宮あかりです", 1, 0, 2, "風宮 あかり");
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES (0, 0, 1, "プリンたべたいのー", "食べ物の恨みは怖いのー", 1007, 0, 1.5, 1, 0, "出雲宮子なのー", 1, 0, 2, "出雲 宮子");
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES (0, 0, 1, "キミもボクの美貌に\n吸い寄せられたんだね。", "いいよ。\n見られることは運命さ…", 1008, 0, 1.4, 1, 0, "ボクは虹村雪。", 1, 0, 2, "虹村 雪");
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES (0, 0, 1, "我が真名は\nアンネローゼ・フォン・シュテッヒパルム！", "人呼んで「疾風の冥姫」!!", 1009, 0, 1.4, 1, 0, "フッ…聞いて後悔するがいい！", 1, 0, 2, "柊杏奈");
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES (0, 0, 1, "うさぎさん、\n運命の王子はんに巡りあわせてくれて", "ほんまおおきにやわ～♪", 1010, 0, 1.5, 1, 0, "マホマホ王国のプリンセス、\nまほ姫どす", 1, 0, 2, "姫宮 真歩");
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES (0, 0, 1, "生き別れたお兄ちゃんを探して\n三千世界！", "ここで会ったが\n100年目～！", 1011, 0, 1.4, 1, 0, "衣之咲璃乃です！", 1, 0, 2, "衣之咲 璃乃");
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES (0, 0, 1, "ち、超能力って…\n何のことかな～？", "…って、お願い！\n誰にも言わないでおいて～！", 1012, 0, 1.4, 1, 0, "私はハツネ、\n結構強いんだよ。\nきらーん☆", 1, 0, 2, "柏崎 初音");
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES (0, 0, 1, "一応カリスマ読モJKやってまっす！", "ヒデサイまぢ\nGF（グッドフィーリング）～♪", 1016, 0, 1.4, 1, 0, "ちょす！\n美波鈴奈だよ～♪", 1, 0, 2, "美波 鈴奈");
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES (0, 0, 1, "東京は遊園地みたいなところさー", "でも、沖縄もとってもいいとこさー", 1017, 0, 1.4, 1, 0, "はいたーい。\n喜屋武香織さー。", 1, 0, 2, "喜屋武 香織");
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES (0, 0, 1, "先生って呼ばれるのは\nくすぐったいから", "イオちゃんって呼んでね。", 1018, 0, 1.4, 1, 0, "支倉伊緒です。", 1, 0, 2, "支倉 伊緒");
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES (0, 0, 1, "あ！/\お兄ちゃ～ん\nまってよ～", "ミミをおいてかないでぇ～", 1020, 0, 1.5, 1, 0, "ふえ…？\nミミ、むずかしいこと\nよくわかんない…", 1, 0, 2, "茜 ミミ");
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES (0, 0, 1, "あの……\nふぇ……", "ふぇぇぇぇぇん……", 1021, 0, 1.5, 1, 0, "あ…あの…えっと…\n栗…林…くるみ…です……", 1, 0, 2, "栗林 くるみ");
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES (0, 0, 1, "こんな私に貴重な時間を\n割いていただき、", "なんてありがとうございます！", 1022, 0, 1.4, 1, 0, "風宮よりです。\nあああああ！", 1, 0, 2, "風宮 より");
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES (0, 0, 1, "おにいちゃんどこいくの？\nえ？", "私こっち行きたいー\nね、早く早くー", 1023, 0, 1.5, 1, 0, "私、アヤネ！\nぷうきちと一緒についてってあげるね！", 1, 0, 2, "北条 綾音");
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES (0, 0, 1, "ふ、不束者ですが\nどうぞ末永く…って、", "これて何か違う…\nあああすみません！", 1025, 0, 1.4, 1, 0, "わっ…わっ…私、\n天野すずめといいます！", 1, 0, 2, "天野 すずめ");
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES (0, 0, 1, "あなたは…運命の……\n伴侶……", "離しませんわ………\n絶対に…!!", 1027, 0, 1.4, 1, 0, "……クスクス…私は\n…倉石恵理子……", 1, 0, 2, "倉石 恵理子");
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES (0, 0, 1, "その無駄を省くことができれば、\nもっと余裕のある暮らしができるっ！", "…そうでしょ？？", 1028, 0, 1.4, 1, 0, "佐々木咲恋よ。\nねえ、世の中に無駄なことが\n多すぎると思わない？", 1, 0, 2, "佐々木 咲恋");
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES (0, 0, 1, "ぇっと…\nキミ、私のこと知らないの?!", "あはは、\n私もまだまだだなぁ～", 1029, 0, 1.4, 1, 0, "桜井望だよ！\nよろしくねっ", 1, 0, 2, "桜井 望");
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES (0, 0, 1, "初めまして、\n私はニノン・ジュベール申すデス！", "ショーグン、\nワタシと一緒に天下統一デース！", 1030, 0, 1.4, 1, 0, "デケデケデンっ！", 1, 0, 2, "ニノン・ジュベール");
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES (0, 0, 1, "でもって私の隣にいるのが……\nえ、見えない？", "おかしいですね……", 1031, 0, 1.4, 1, 0, "上喜しのぶです。\n手元のドクロが父です。", 1, 0, 2, "上喜 しのぶ");
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES (0, 0, 1, "けんども\nそれには足りないモンが…", "そう、\nオラのボケに突っ込める相方が…！", 1033, 0, 1.5, 1, 0, "目指すはビッグな\nお笑い芸人だっぺ！", 1, 0, 2, "野戸まひる");
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES (0, 0, 1, "ちょっと緊張しちゃって…", "ちょ\nちょっと一杯飲んできます…！", 1034, 0, 1.4, 1, 0, "あの…私…綾瀬ゆかりです…\nあの…ごめんなさい！", 1, 0, 2, "綾瀬 ゆかり");
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES (0, 0, 1, "知らない人とは話しちゃいけないので", "これ以上お話しすることは…\nないです！", 1036, 0, 1.5, 1, 0, "氷川鏡華…です", 1, 0, 2, "氷川 鏡華");
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES (0, 0, 1, "……あ、アラーム。", "私体が弱いから、\n30分に一度休憩しないと\nいけないんです。", 1038, 0, 1.4, 1, 0, "柏崎…栞です。", 1, 0, 2, "柏崎 栞");
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES (0, 0, 1, "私、一人も友達がいなくて……", "野に咲く花が、\n唯一の話相手です。", 1040, 0, 1.4, 1, 0, "ふ、双葉碧です。", 1, 0, 2, "双葉 碧");
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES (0, 0, 1, "私の歌声で、\n皆さんが幸せになってくれたらいいなって…", "そう思っています。", 1042, 0, 1.4, 1, 0, "三角千歌です。", 1, 0, 2, "三角 千歌");
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES (0, 0, 1, "あぁ？\nお前のそいつの仲間か？", "う、疑ってすまなかったな…", 1043, 0, 1.4, 1, 0, "安芸真琴だ。", 1, 0, 2, "安芸 真琴");
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES (0, 0, 1, "生けとし生ける全ての者よ！", "わらわの偉大な力に\nひれ伏すがいい！\nはっはっは！", 1044, 0, 1.4, 1, 0, "わらわこそは夜を総べる者！", 1, 0, 2, "イリヤ・オーンスタイン");
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES (0, 0, 1, "ぐふふふふ……はっ！", "ｌク、クウカに何かご用ですか!?", 1045, 0, 1.4, 1, 0, "そこで騎士は妖精を乱暴に……", 1, 0, 2, "遠見 空花");
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES (0, 0, 1, "自由気ままで♪\n寝て遊んで、食べてケンカして…", "う～ん…\n猫ってホントに最高にゃ～♪", 1046, 0, 1.4, 1, 0, "宮坂たまきにゃ♪\n猫はいいにゃよ？", 1, 0, 2, "宮坂たまき");
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES (0, 0, 1, "それでは早速クエストに…", "…と思ったら\nバイトの時間だ！\nまたあとでね！", 1048, 0, 1.4, 1, 0, "大神美冬よ！", 1, 0, 2, "大神 美冬");
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES (0, 0, 1, "クエストもバトルも\n掃除も洗濯も", "お姉ちゃんがぜ～んぶ\nやってあげるからね！", 1049, 0, 1.4, 1, 0, "星野静流だよ！", 1, 0, 2, "星野静流");
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES (0, 0, 1, "見ての通りの\nセクシー美少女で", "学校では誰もが憧れる\nアイドル的な存在ってやつよ♪", 1050, 0, 1.5, 1, 0, "アタシは玉泉美咲。", 1, 0, 2, "玉泉美咲");
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES (0, 0, 1, "？？？？", "？？？？", 1052, 0, 1.4, 1, 0, "？？？", 1, 0, 2, "リマ");
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES (0, 0, 1, "菓子でつろうなどと\n稚拙な策を……", "そ、そこまでいうなら\nもらってやる", 1053, 0, 1.5, 1, 0, "モニカ・ヴァイスヴィントだ。", 1, 0, 2, "モニカ・ヴァイスヴィント");
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES (0, 0, 1, "菓子でつろうなどと\n稚拙な策を……", "そ、そこまでいうなら\nもらってやる", 1058, 0, 1.5, 1, 0, "モニカ・ヴァイスヴィントだ。", 1, 0, 2, "ペコリーヌ");
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES (0, 0, 1, "菓子でつろうなどと\n稚拙な策を……", "そ、そこまでいうなら\nもらってやる", 1059, 0, 1.5, 1, 0, "モニカ・ヴァイスヴィントだ。", 1, 0, 2, "コッコロ");
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES (0, 0, 1, "菓子でつろうなどと\n稚拙な策を……", "そ、そこまでいうなら\nもらってやる", 1060, 0, 1.5, 1, 0, "モニカ・ヴァイスヴィントだ。", 1, 0, 2, "キャル");
